    'Name of the second domain of your shop, (e.g. myshop-media-server-1.com). If you do not have another domain, leave this field blank.' => 'اسم النطاق الثاني لمتجرك، (على سبيل المثال: myshop-media-server-1.com). إذا لم يكن لديك نطاق آخر، اترك هذا الحقل فارغًا.',
    'Name of the third domain of your shop, (e.g. myshop-media-server-2.com). If you do not have another domain, leave this field blank.' => 'اسم النطاق الثالث لمتجرك، (على سبيل المثال: myshop-media-server-2.com). إذا لم يكن لديك اسم نطاق آخر، أترك هذا الحقل فارغًا.',
    'Notifications are numbered bubbles displayed at the very top of your back office, right next to the shop\'s name. They display the number of new items since you last clicked on them.' => 'التنبيهات هي فقاعات مرقّمه تُعرض في اعلى الصفحه في واجهة الادارة، بجوار اسم المتجر. الفقاعات تعرض ارقام الوحدات الجديده منذ اخر مره قمت بالنقر عليهم.',
